import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import Presentation from '../presentation';

function Home() {
  return (
    <>
      <HeroSection />
      <Presentation />
      <Cards />
      <Footer />
    </>
  );
}

export default Home;
